import React from 'react';
import './zhuce.css';

class Zhuce extends React.Component{
	constructor(){
		super();
		this.state={
			Phone:""
		}
	}
	getVal=()=>{
		console.log(this.refs)
	}
	render(){
		return(
				<div>
					<div className="all">
						<span className="X">X</span>
						<div className="itemss">
							<div className="font-logo">登陆豆瓣</div>
							<span className="font-hui">登陆注册表示同意</span>&nbsp;&nbsp;
							<span className="font-green">豆瓣使用协议,隐私政策</span>
						</div>
						<div className="inputs">
							<input ref="inp01" onChange={this.getVal} value={this.state.Phone} placeholder="手机号" type="phone" className="phone"></input>
							<input placeholder="密码" type="text" className="password"></input>
							<input placeholder="确认密码" type="text" className="password"></input>
						</div>
						<div className="button">注册</div>
					</div>
				</div>
		)
	}
}

export default Zhuce;
